// useMyCustomHook.js
import { useState } from 'react';

function Player(n_name) {
  const [name, setName] = useState(n_name);
  const [passes, setPasses] = useState({
    "3": 0,
    "2": 0,
    "1": 0,
    "0": 0
  });
  const [average, setAverage] = useState(0);

  // You can also include any logic that manipulates these state variables here

  return { name, setName, passes, setPasses, average, setAverage };
}

export default Player;
